import React from 'react';
import {Navbar, Input,Collapse,NavbarToggler, NavItem, NavLink, Nav, NavbarBrand} from 'reactstrap';

class Navegacion extends React.Component{
    render(){
        return(
            <Navbar color="light" light expand="sm">
               
                <NavbarBrand href="/"><img src={this.props.logo} alt=""></img> &nbsp;{this.props.titulo} </NavbarBrand>
                <Input className=".d-sm-none .d-md-block" type="search" name="search" id="searchbar" placeholder="Buscar" />
                <NavbarToggler/>
                <Collapse navbar>
                    <Nav className="ml-auto" navbar>
                        <NavItem>
                                    <NavLink href="/">Home</NavLink>
                        </NavItem>
                        <NavItem>
                                    <NavLink href="/">Productos</NavLink>
                        </NavItem>
                        <NavItem>
                                    <NavLink href="/">Contacto</NavLink>
                        </NavItem>
                    </Nav>
                </Collapse>
            </Navbar>
        );

    }
}

export default Navegacion;
